/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Component } from 'react';

class MenuItems extends Component{
    render(){
        return (
            <li>
                <a href='#'>{this.props.name}</a>
            </li>
        );
    }
}

export default MenuItems;
